import React from 'react'
import SlideShow from './SlideShow'
class Projects extends React.Component{
    constructor(props){
        super(props);
        this.projects = [
            {name:"Cookflex", repository: "https://github.com/Dund0/FoodApp", date:"JANUARY 2020 - MAY 2021 ", description: "Created a mobile app for Android in Android Studio. I worked on the backend with Firebase, a service by Google for mobile and web applications, to manage users and their data, like images and emails. "},
            {name:"Text-to-Speech Bot", repository: "https://github.com/CSUN-ACM/Speech-To-Text", date:"JANUARY 2020 - MAY 2021 ", description: "Utilizing Python and its various libraries, we created a bot for converting a person's speech to text. I helped in creating the model for the bot and then testing it with PyAudio "},
            {name:"Quiz App", repository: "https://github.com/br8832/COMP484", date:"JANUARY 2021 - MAY 2021", description: "Create a quiz game in meteor. I created the backend for interfacing with some API's and designed the look of our quiz game. Then, with the meteor tools, I hosted it for a short while"},
            {name:"This website", repository: "https://github.com/br8832/portfolio", date:"MARCH 2022 - APRIL2022", description: "Recreated a resume site from a class but using React. The purpose of which is to understand React better and update continuously my experience."}
        ]
    }
    render(){
        return(
            <Slideshow info={this.projects}/>
        )
    }
}
