      <h3>Lead...</h3>
      <ul>
        <li>Database side of our app</li>
        <li>Website side of the database interface</li>
        <li>Python team to process audio</li>
      </ul>
    </li>
  </ul>
</div>
{/* end of Job Details block. */}
export default Projects
